import React from 'react';
import Landing from './Landing';
import Portfolio from './Portfolio';
import Contact from './Contact';
import webDevImage from '../assets/gfp-web-dev.jpeg';
import uiDesignImage from '../assets/gfp-ui-design.jpeg';
import systemsImage from '../assets/gfp-systems.jpeg';
import './carousel.css';

const WebDevPanel = () => {
   return (
      <div className='row'>
         <div className='col'>
            <img
               className='card-img'
               src={webDevImage}
               alt='Full Stack Web Development'
            />
         </div>
      </div>
   );
};

const UiDesignPanel = () => {
   return (
      <div className='row'>
         <div className='col'>
            <img className='card-img' src={uiDesignImage} alt='User Interface Design' />
         </div>
      </div>
   );
};

const SystemsPanel = () => {
   return (
      <div className='row'>
         <div className='col'>
            <img
               className='card-img'
               src={systemsImage}
               alt='Systems Engineering & Automation'
            />
         </div>
      </div>
   );
};

export default function Panel() {
   return (
      <>
         <div id='glassPaneCarousel' className='carousel slide align-middle'>
            <div className='carousel-indicators'>
               <button
                  type='button'
                  data-bs-target='#glassPaneCarousel'
                  data-bs-slide-to='0'
                  className='active'
                  aria-current='true'
                  aria-label='Slide 1'
               ></button>
               <button
                  type='button'
                  data-bs-target='#glassPaneCarousel'
                  data-bs-slide-to='1'
                  aria-label='Slide 2'
               ></button>
               <button
                  type='button'
                  data-bs-target='#glassPaneCarousel'
                  data-bs-slide-to='2'
                  aria-label='Slide 3'
               ></button>
            </div>
            <div className='carousel-inner'>
               <div className='carousel-item active'>
                  <Landing />
               </div>
               {/* <div className='carousel-item'>
                  <Portfolio />
               </div> */}
               <div className='carousel-item'>
                  <WebDevPanel />
               </div>
               <div className='carousel-item'>
                  <Portfolio />
               </div>
               <div className='carousel-item'>
                  <Portfolio />
               </div>
               <div className='carousel-item'>
                  <Contact />
               </div>
            </div>
            <button
               className='carousel-control-prev'
               type='button'
               data-bs-target='#glassPaneCarousel'
               data-bs-slide='prev'
            >
               <span className='carousel-control-prev-icon' aria-hidden='true'></span>
               <span className='visually-hidden'>Previous</span>
            </button>
            <button
               className='carousel-control-next'
               type='button'
               data-bs-target='#glassPaneCarousel'
               data-bs-slide='next'
            >
               <span className='carousel-control-next-icon' aria-hidden='true'></span>
               <span className='visually-hidden'>Next</span>
            </button>
         </div>
      </>
   );
}
